float** Helper_normalize_each_row(MASK_SELECTOR mask, uint16_t x, uint16_t y)	//don't need to return unless ... we need a whole new mat?
{	//currently, it edits the current mat, but I can make a new if needed.
	float* row_sums = (float *)MEM_callocN(x * sizeof(float), "row_sum");
	float** maskcpy = (float **)MEM_callocN(x * sizeof(float*), "maskcpy");					//(float **)malloc(sizeof(float*) * x);//(float **)MEM_MEM_callocNN(sizeof(float*) * x, "mat_tmp_main");
	for (int i = 0; i < x; i++) {
		maskcpy[i] = (float *)MEM_callocN(y * sizeof(float), "sub_maskcpy");	//(float *)MEM_MEM_callocNN(sizeof(float) * x, "mat_tmp_sub");
	}
	float** mat = getMask(mask); //getMask(mask);
	for (int i = 0; i < x; i++) {
		for (int j = 0; j < y; j++) {
			//printf("new mat: i: %d, j: %d, %f\n", i, j, maskcpy[i][j]);
			//printf("const mat: i: %d, j: %d, %f\n", i, j, mat[i][j]);
			//maskcpy[i][j] = mat[i][j];
		}
	}
	
	for (int i = 0; i < x; i++) {
		for (int j = 0; j < y; j++) {
			row_sums[i] += mat[i][j];
		}
	}
	for (int i = 0; i < x; i++) {
		for (int j = 0; j < y; j++) {
			maskcpy[i][j] = mat[i][j]/row_sums[i];
		}
	}
	for (int i = 0; i < x; i++) {
		MEM_freeN(mat[i]);
	}
	MEM_freeN(mat);
	MEM_freeN(row_sums);
	return maskcpy;
}	//better have zoom calls to check after many changes.


