//different row size, col size diff
float** Helper_apply_mask_on_neighbor_verts(MASK_SELECTOR mask, BMVert* nbverts, uint16_t row, uint16_t col)
{	//9, 3
	float** maskcpy = NULL;
	//printf("row: %d, col: %d\n", row, col);
	float** nbmat = Helper_convert_verts_from_list_to_matrix(nbverts, col);	//bugs out sometimes, lookinto it why row works??
	maskcpy = Helper_normalize_each_row(mask, row, col);
	float** retMat = (float **)MEM_callocN(row * sizeof(float*), "ret_mat");
	for (int i = 0; i < row; i++) {
		retMat[i] = (float *)MEM_callocN(3 * sizeof(float), "sub_ret_mat");
	}
	//dot product 9x9 mat and 9x3			//(48x7) x (7x3) another ex == 48x3, passed in row = 48, col = 7
	for (int i = 0; i < row; i++) {	//x = row, y = col. should be 9x3
		//retMat[i][j] = 0.0f;
		for (int j = 0; j < 3; j++) {	//used to be col. wouldn't make sense since we always get #x3 out.
			for (int k = 0; k < col; k++) {	//pretty sure this is dot product calc
				retMat[i][j] += maskcpy[i][k] * nbmat[k][j];
			}
			//printf("retMat[%d][%d] = %f\n", i, j, retMat[i][j]);
		}
	}
	//free it all
	for (int i = 0; i < row; i++) {
		MEM_freeN(maskcpy[i]);
	}
	for (int i = 0; i < col; i++) {
		MEM_freeN(nbmat[i]);
	}
	MEM_freeN(maskcpy);
	MEM_freeN(nbmat);
	return retMat;
}

