float** ExtraordinaryPatchConstructor_get_patch(BMVert* vert)
{
	//logic is sound because we will have 7 vertices.
	//based on however many edges, let's say 3 edges from center vert (here it's the 6 as center)
	/*
		  0
        / | \    Get neighbor vert order 0 1 -> 2 3 -> 4 5 -> 6
       /  |  \
      1   6   5
       \  / \ /
        2    4
         \  /
          3
	*/
	//from this we have eopsct3 in this case which is csv of 48x7 (row x col)
	//so mask x (7verts (7x3)) == (48x7) x (7x3) = 48x3
	//works out since col matches rows and we would get output of (48x3)
	
	//this should be done but make sure :P -5/12
	BsplinePatch patch = {0, 0, NULL};
	patch.deg_u = 3;
	patch.deg_v = 3;
	BMVert* nb_verts = ExtraordinaryPatchConstructor_get_neighbor_verts(vert);
	int size = (BM_vert_edge_count(vert) * 2) + 1;
	for (int i = 0; i < size; i++) {
		for (int j = 0; j < 3; j++) {
			if (isnan(nb_verts[i].co[j]) == true || nb_verts[i].co[j] < -10000000 || nb_verts[i].co[j] > 10000000) {
				//printf("lol thx blender\n");
				nb_verts[i].co[j] = 0.0f;
			}
		}
	}
	//finish rest
	int count = BM_vert_edge_count(vert);
	int mask_type = BM_vert_edge_count(vert) + 2;
	int row_c = 0;
	int col_c = 0;
	if (count == 3) {
		row_c = 48;
		col_c = 7;
	} else if (count == 5) {
		row_c = 80;
		col_c = 11;
	} else if (count == 6) {
		row_c = 384;
		col_c = 13;
	} else if (count == 7) {
		row_c = 448;
		col_c = 15;
	} else if (count == 8) {
		row_c = 512;
		col_c = 17;
	}
	float** bezier_coefs = Helper_apply_mask_on_neighbor_verts(mask_type, nb_verts, row_c, col_c);
	float** bspline_coefficients = BezierBsplineConverter_bezier_to_bspline(bezier_coefs, patch.deg_u, patch.deg_v, row_c);
	float* bspline_coefs_arr = Helper_convert_verts_from_matrix_to_list(bspline_coefficients, row_c);
	int num_of_coef_per_patch = (patch.deg_u + 1) * (patch.deg_v + 1);
	int num_of_patches = row_c / num_of_coef_per_patch;	//48/16 = 3
	patch.deg_u++;
	patch.deg_v++;
	float** retMat = Helper_split_list(bspline_coefs_arr, row_c*3, row_c);	//splits it into rows x 3.
	return retMat;
}

